css:
@-moz-document domain("trashbox.ru") {
body {
    background-image: url(https://akket.com/wp-content/themes/theme/images/tx.gif);
    overflow-x: hidden;
}

#div_menu_page, #div_top_logo .cell2 { background: #2b2b2b; height: 66px; }
#div_top_logo .cell2:after  { border-top: transparent; }
#div_layout_top { position: absolute;}

#div_top_menu_simple {
    position: absolute;
    width: 100%;
    top: 66px;
    height: 56px;
    padding: 14px 0;
    background: white;
}

#div_top_menu_text a, #div_top_menu_text a:visited {
    color: black;
    background: none;
    line-height: 24px;
    border: 1px solid #000;
    border-radius: 3px;
    font-weight: 700;
    height: 24px;
    padding-top: 0px;
    margin-right: 9px;
    margin-top: 1px;
}

#div_top_logo .div_cell:first-child {
        background-image: url('data:image/png;base64,');
    width: 40px;
    background-repeat: no-repeat;
    background-position: center;
    background-size: contain;
}

#img_top_logo {
    display: none;
}

.div_layout {
    max-width: 1024px;
}

div#div_layout_top:after {
    content: '';
    background: #2b2b2b;
    width: 200%;
    height: 66px;
    position: absolute;
    top: 0;
    z-index: -999;
    left: -50%;
}

.name2 {
    display: none;
}

.page_index .div_layout_content { margin-top: 64px; }
#div_social_bottom {
    position: absolute;
    top: 7px;
    background: #2b2b2b;
    right: 10%;
    z-index: 999;
}

div#div_top_menu_simple:after {
    content: '';
    background: white;
    height: 56px;
    width: 200%;
    position: relative;
    left: -50%;
    z-index: -5;
    display: block;
    top: -14px;
    border-bottom: 1px solid #eaeaea;
}

#div_top_menu_text a.first { padding-left: 10px }
#div_top_logo .name1 {
    margin-top: 2px;
    font-family: 'Trebuchet MS';
    text-transform: inherit;
    margin-left: -5px;
    font-size: 28px;
    font-weight: 400;
}

.div_top_black_buttons { display: none; }
#div_profile_button {      position: absolute;
    top: -15px;
    left: -343px;
}

#div_menu_page:after, #div_top_logo .cell2:after, #div_top_menu_text a.current:after, #div_top_menu_text a:hover::after, .div_top_black_buttons:after { border-top: none }
#div_top_menu_text a:hover, #div_top_menu_text a.current { border: 1px solid #f13737; color: #f13737 !important; background: white !important }
#div_layout_top_placeholder { height: 122px; }


html:after {
    content: '';
    width: 200px;
    height: 200px;
    position: absolute;
    background: red;
    top: 130px;
    right: -50%;
    background-image: url('data:image/jpeg;base64,');
}
}
